import React from 'react';
import { AppBar, Toolbar, Typography, Button } from '@mui/material';
import { Link } from 'react-router-dom';
import './Navbar.css';

const Navbar = ({ isLoggedIn }) => {
    return (
        <AppBar position="static" style={{ backgroundColor: '#3f51b5' }}>
            <Toolbar>
                <Typography variant="h6" style={{ flexGrow: 1, color: '#fff' }}>
                    JDGurus Portal
                </Typography>
                {!isLoggedIn ? (
                    <>
                        <Button color="inherit" component={Link} to="/" style={{ margin: '0 10px', backgroundColor: '#ff4081', color: '#fff' }}>Login</Button>
                        <Button color="inherit" component={Link} to="/signup" style={{ margin: '0 10px', backgroundColor: '#ff4081', color: '#fff' }}>Signup</Button>
                    </>
                ) : (
                    <>
                        <Button color="inherit" component={Link} to="/dashboard" style={{ margin: '0 10px', backgroundColor: '#4caf50', color: '#fff' }}>Dashboard</Button>
                        <Button color="inherit" component={Link} to="/inventory" style={{ margin: '0 10px', backgroundColor: '#4caf50', color: '#fff' }}>Inventory</Button>
                        <Button color="inherit" component={Link} to="/barcode-selector" style={{ margin: '0 10px', backgroundColor: '#4caf50', color: '#fff' }}>Barcode Selector</Button>
                        <Button color="inherit" component={Link} to="/label-printer" style={{ margin: '0 10px', backgroundColor: '#4caf50', color: '#fff' }}>Label Printer</Button>
                    </>
                )}
            </Toolbar>
        </AppBar>
    );
};

export default Navbar;
